      SELECT * FROM tab0 (FORMAT parquet) WHERE NOT col1 BETWEEN col1 + - 83 - - col1 * + col1 AND CAST ( - CAST ( NULL AS INTEGER ) AS INTEGER );
  - name: tab0

outputs:
